import React from "react";

const DiaryList = ({ diaryList }) => {
  return (
    <>
      <h2>일기 리스트</h2>
      {diaryList.map((data) => (
        <>
          <div>{data.length}개의 일기가 있습니다.</div>
        </>
      ))}
    </>
  );
};

export default DiaryList;
